import React from 'react'

const Cards = () => {
    const cards=[{id:1,title:"The Best Design for a House" ,image:'https://www.w3schools.com/html/pic_trulli.jpg'},{id:2, title:"The Most amazing laptop on Earth", image:'https://i.gadgets360cdn.com/large/apple_macbook_air_M1_2020review_cover_1607598067132.jpg'},{id:3,title:"The mose beautiful flower ever human see", image:'https://www.gardeningknowhow.com/wp-content/uploads/2021/07/sulfur-cosmos-mexican-aster-flowers-400x300.jpg'}]
    return (
        <div className="cards">
            {cards.map((item)=>{
                return(
                    <div className="card">
                        <h2>{item.title}</h2>
                        <img src={item.image}/>
                    </div>
                )
            })}
        </div>
    )
}

export default Cards
